<P><A NAME="id_endp"></A><B>(endp <I>object</I>)</B></P>

<P>Returns <A HREF="robo8vck.htm">t</A> for <A HREF="robo4euk.htm">nil</A>, <A HREF="robo4euk.htm">nil</A> for conses. It is an error for <I>object</I> to be anything else.</P>
<PRE><CODE>(endp nil) =&gt; t
(endp '(a b c)) =&gt; nil</CODE></PRE>
